def find_max_divisible_number(digits):
    if digits.count(0) != 0:
        return -1
    digits.remove(0)
    digits = sorted(digits, reverse=True)
    ans = []
    while digits:
        c = sum(digits) % 3
        if c == 0:
            break
        flag = True
        for i in range(len(digits) - 1, -1, -1):
            if digits[i] % 3 == c:
                digits.pop(i)
                flag = False
                break
        if flag:
            for i in range(len(digits) - 1, -1, -1):
                if digits[i] % 3 != 0:
                    digits.pop(i)
                    flag = False
                    break
            for i in range(len(digits) - 1, -1, -1):
                if digits[i] % 3 != 0:
                    digits.pop(i)
                    flag = False
                    break
    if not digits or digits[0] == 0:
        return 0
    ans = ''.join(map(str, sorted(digits, reverse=True)))
    return int(ans + '0')

